  false,\n\t\"url\": null,\n\t\"notes\": \"TR-33: Maps are presented showing the areal
  distribution in the contiguous 48 states of evaporation (1) observed from Class
  A pans from from May through October, (2) estimated for a free water surface (FWS)
  and (3) estimated for an FWS for the entire year. A map is presented of the coefficients
  to convert from pan evaporation to FWS evaporation. Sources of data, analyses of
  the maps, and limitation on their use are described. TR-34: This publication is
  a compilation of monthly, seasonal, and annual averages of estimated pan evaporation
  based on observations from Class A pans and on meteorological measurements by the
  National Weather Service (NWS) and cooperating agencies. It replace Technical Paper
  No. 13 (U.S. Weather Bureau, Hydrologic Branch, Division of Climatological and Hydrologic
  Services, 1950). These tabulations were generated from the augmentation of a smaller
  data set used to develop evaporation maps published in NOAA Technical Report NWS-33,
  Evaporation Atlas for the Contiguous 48 United States, (Farnsworth et al., 1982).
  This report and its companion report, the evaporation atlas, should facilitate the
  determination of monthly values of evaporation at most points in the country.nnFarnsworth,
  R.K., Thompson, E.S., and Peck, E.L, 1982, Evaporation atlas for the contiguous
  48 United States, NOAA Technical Report NWS 33, National Oceanic and Atmospheric
  Administration, Washington, DC, p. 27.nnFarnsworth, R.K. and Thompson, E.S., 1982,
  Mean monthly, seasonal, and annual pan evaporation for the United States, NOAA Technical
  Report NWS 34, National Oceanic and Atmospheric Administration, Washington, DC,
  p. 85.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
